import React, { Component } from 'react';
import { NavigationBar } from './NavigationBar.js';
import Blurb from './Blurb.js';
import classNames from 'classnames';
import './App.css';
import Tachyonsocialfooter from './Tachyonsocialfooter.js'
import { Container, Row, Col } from 'reactstrap';
import Carousel from './Carousel.js';
import AOS from 'aos'; //Animation library import and CSS
import 'aos/dist/aos.css';
import FadedHeader from './FadedHeader.js'
import Portrait from './Portrait.js';
import Anchor from './Anchor.js'
import Java from './images/java.png';
import Javascript from './images/javascript.png';
import CSS from './images/css.png';
import Node from './images/nodejs.png';
import Reacts from './images/reactjs.png';
import AWS from './images/aws.png';
import CPP from './images/cpp.png';
import SQL from './images/sql.png';
import PHP from './images/php.png';

class App extends Component {

  componentDidMount(){
    AOS.init({
      duration : 1800,
    })
  }


  render() {

    return (
      <div className={classNames("App", this.state)}>
       <NavigationBar handleTheme={this.handleTheme}/>

        <div className="App-body">

          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="So....." side="right" fade="left"></FadedHeader> <hr />

            <br />


          <Container id="App-body">
            <Row className="padded-top">
              <Col lg={{size:7, offset:3}} sm={{size:8, offset:2, order:1}} xs={{order:12}}>
                <div data-aos="zoom-in-up"><Portrait></Portrait></div>
              </Col>
              <Col data-aos="zoom-in-up" lg={{size:5, offset:1}} sm={{size:6, order:12}} xs={{order:1}}>
                <h1>Scott</h1> <hr />
                testing some stuff
                <hr />
              </Col>
            </Row>
          </Container>

          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Languages" side="left" fade="right"></FadedHeader>
          <Container id="Languages">
            <Row className="padded-top">

              <section class="lang">
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={Java} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={CPP} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={Node} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={Reacts} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={Javascript} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={CSS} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={AWS} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={SQL} height="100%" width="100%" /> </div>
                <div class="lang--content"> <img style={{borderRadius:"5%"}} src={PHP} height="100%" width="100%" /> </div>

              </section>


            </Row>
          </Container>
            <br />
          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Academics" side="right" fade="left"></FadedHeader>
          <Container id="Academics">
            <Row className="padded-top">
              <Carousel></Carousel> {/* Moved data-aos to component*/}
            </Row>
          </Container>
            <br />
          <div style={{minHeight:"3em"}}></div>

          <FadedHeader title="Work Experience" side="left" fade="right"></FadedHeader>
          <br />
          <Container id="Jobs">
            <Row className="padded-top">
              <Col>
              //  <WorkCards></WorkCards> {/* Moved data-aos to component*/}
              </Col>
            </Row>
          </Container>
            <br /><br />

          <FadedHeader title="Projects" side="right" fade="left"></FadedHeader>
            <br />
          <Container id="Projects">
            <Row className="padded-top">
              <h2>Projects will go here. Coming soon! <br /> In the meantime you can
              <Anchor name="find them here." url="https://github.com/mrscottstubbs"/></h2>
            </Row>
          </Container>

          <div style={{minHeight:"3em"}}></div>

        </div>

        <Blurb />

        <div id="bottom"> <hr/>
          <Tachyonsocialfooter></Tachyonsocialfooter>
        </div>

      </div>
    );
  }
}

export default App;
